import React, { Component } from 'react'
import './Contact.css'

export default class Contact extends Component {
    render() {
        return (
            <div className="text-contact">
                <h3>โรงแรมนนทบุรีไนท์พลาซ่า</h3>
                <p>Email : sanchaipangboot@gmail.com</p>
                <p>Tel: 064-352-3713</p>

            </div>
        )
    }
}
